//以下是各种函数
// 切换视角
function showcontext(node) {
    if (last_selected > -1) {
        sprites[last_selected].color = '#ffff80';
        sprites[last_selected].textHeight = textHeight;
    }
    sprites[node.id].color = '#ffdddd';
    sprites[node.id].textHeight = textHeight * 2;
    if (ismute == 0) {
        pronunciation(node, language);
    }
    last_selected = node.id;

    var fn = findNeighbors(links, node.id, rel_count);
    neighbors = fn[0];
    neighbor_links = fn[1];

}


//给一个节点找相邻的节点
function findNeighbors(links, nodeid, n) {
    neighbors = []
    neighbor_links = []
    new_neighbor_links = []
    rankn = []
    //找到有用的link
    for (var i = 0; i < links.length; i++) {
        if ((links[i]['source']['id'] === nodeid || links[i]['target']['id'] === nodeid) &&
            (neighbor_links.indexOf(i) === -1)) {
            neighbor_links.push(i);
            rankn.push(links[i]['weight']);
        }
    }
    rankn.sort(function sortNumber(a, b) { return b - a; });
    maxvalues = rankn[rankn.length < n ? rankn.length - 1 : n];
    //找到前n个link
    for (var j = 0; j < neighbor_links.length; j++) {
        if (links[neighbor_links[j]]['weight'] >= maxvalues) {
            new_neighbor_links.push(neighbor_links[j]);
        }
    }
    //添加节点
    for (var j = 0; j < new_neighbor_links.length; j++) {
        link = links[new_neighbor_links[j]]
        if ((link['source']['id'] === nodeid) &&
            (neighbors.indexOf(link['target']['id']) === -1)) {
            neighbors.push(link['target']['id']);

        } else if ((link['target']['id'] === nodeid) &&
            (neighbors.indexOf(link['source']['id']) === -1)) {
            neighbors.push(link['source']['id']);
        }
    }
    return [neighbors, new_neighbor_links];
}

//去除数组重复项
function uniq(array) {
    var temp = [];
    for (var i = 0; i < array.length; i++) {
        //如果当前数组的第i项在当前数组中第一次出现的位置是i，才存入数组；否则代表是重复的
        if (array.indexOf(array[i]) == i) {
            temp.push(array[i])
        }
    }
    return temp;
}


//随机选择一个节点作为目标，相机切换
function transform() {
    if (isplay == 1) {
        i = Math.floor(Math.random() * (nodeids.length - 1));
        show_node(nodeids[i]);
        // nodeids.splice(i,1);
    }
}


//在指定画布上画图
function Graph_nodes_to_canvas(gData, canvas) {
    Graph = ForceGraph3D()(canvas)
        .graphData({ nodes: Object.values(nodes), links: links })
        //边的样式，
        .linkAutoColorBy('weight')
        .linkWidth('weight')
        .linkOpacity(0.4)

        .nodeAutoColorBy('id')
        .nodeVal('size')
        .nodeLabel(node => `${node.rank}: ${node.name}`)

        .nodeThreeObjectExtend(true)
        .nodeThreeObject(node => {
            var sprite = new SpriteText(node.name);
            sprite.textHeight = textHeight;
            sprite.color = '#ffff80';
            sprites[node.id] = sprite;
            return sprite;
        })
        .nodeOpacity(0.7)

        .onNodeHover(node => {
            canvas.style.cursor = node ? 'pointer' : null
        })
        .onNodeClick(node => {

            showcontext(node);
            isplay = 0;
            play();
            const distRatio = 1 + distance / Math.hypot(node.x, node.y, node.z);
            Graph.cameraPosition({ x: node.x * distRatio, y: node.y * distRatio, z: node.z * distRatio },
                node, 3000);
        })
    return Graph;
}

//将数据处理成为gaph所需的node、link格式，返回字典，属性links、nodes、nodeids
function process_data(result, nodes) {
    var links1 = [];
    var nodes1 = {};
    var nodeids1 = [];
    result.map(r => {
        // tempnode=r['source'];

        var source = r['source'];
        source.id = source.rank;
        nodes1[source.id] = source;
        if (nodeids1.indexOf(source.id) == -1) {
            nodeids1.push(source.id);
        };

        var target = r['target'];
        target.id = target.rank;
        nodes1[target.id] = target;
        if (nodeids1.indexOf(target.id) == -1) {
            nodeids1.push(target.id);
        };

        var rel = r['relation'];
        rel['weight'] = rel['weight'] / 200;
        // rel['id']=rel.id; 
        links1.push(Object.assign({ source: source.id, target: target.id }, rel));
    });
    nodeids1 = uniq(nodeids1);
    var reg = new RegExp(',', "g")

    nodeids1.map(nodeid => {
        node = nodes1[nodeid];
        node['size'] = 0.2;
        if (language != 'en') {
            node['title'] = node['name'];
        } else {
            node['title'] = node['name'];
        }
        node['color'] = node['rank'] * 800;
        // node= Object.assign(node);
        if (node != null) { return node; } else {}
    });
    var newresult = {};

    newresult['links'] = links1;
    newresult['nodes'] = nodes1;
    newresult['nodeids'] = nodeids1;

    return newresult;

}